(2, 1, '<E1v3bOE-00000009T4M-3M0V@d202.dataserver.ro>', 'contact@smartbizz.ro', 'SmartBizz', 'pavel@5qb.ro', NULL, NULL, 'Contul tău SmartBizz a fost activat', '\r\n<!DOCTYPE html>\r\n<html lang=\"ro\">\r\n<head>\r\n  <meta charset=\"UTF-8\">\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n  <title>Bine ai venit în SmartBizz®!</title>\r\n  <style>\r\n    body {\r\n      font-family: Arial, sans-serif;\r\n      color: #333333;\r\n      background-color: #f4f4f4;\r\n      margin: 0;\r\n      padding: 0;\r\n    }\r\n    .container {\r\n      padding: 30px;\r\n      border: 1px solid #dddddd;\r\n      border-radius: 12px;\r\n      background-color: #ffffff;\r\n      max-width: 600px;\r\n      margin: 40px auto;\r\n      box-shadow: 0 4px 15px rgba(0, 0, 0, 0.07);\r\n    }\r\n    .logo-wrapper {\r\n      text-align: center;\r\n      margin-bottom: 25px;\r\n	 \r\n    }\r\n    .logo-frame {\r\n      display: inline-block; /* Face chenarul sa se muleze pe imagine */\r\n      padding: 10px;\r\n      border: 1px solid #eeeeee; /* Culoare subtila pentru chenar */\r\n      border-radius: 12px;\r\n    }\r\n    .logo-frame img {\r\n      max-width: 180px;\r\n      height: auto;\r\n      display: block;\r\n    }\r\n    .header {\r\n      font-size: 24px;\r\n      font-weight: bold;\r\n      color: #333333;\r\n      text-align: center;\r\n      margin-bottom: 15px;\r\n    }\r\n    .brand-text {\r\n      color: #abe103; /* Culoarea brandului */\r\n    }\r\n    .content {\r\n      font-size: 16px;\r\n      line-height: 1.7;\r\n      text-align: center;\r\n    }\r\n    .credentials-box {\r\n      background-color: #f9f9f9;\r\n      border: 1px dashed #cccccc;\r\n      padding: 20px;\r\n      border-radius: 8px;\r\n      margin: 25px auto;\r\n      max-width: 80%;\r\n    }\r\n    .credentials-box p {\r\n      margin: 5px 0;\r\n      font-size: 15px;\r\n    }\r\n    .credentials-box .password {\r\n      font-weight: bold;\r\n      color: #000000;\r\n      background-color: #e9e9e9;\r\n      padding: 5px 10px;\r\n      border-radius: 5px;\r\n      display: inline-block;\r\n    }\r\n    .button-container {\r\n      text-align: center;\r\n      margin-top: 30px;\r\n    }\r\n    .cta-button {\r\n      display: inline-block;\r\n      background-color: #abe103;\r\n      color: #ffffff;\r\n      padding: 14px 28px;\r\n      border-radius: 8px;\r\n      text-decoration: none;\r\n      font-weight: bold;\r\n      font-size: 16px;\r\n      border: none;\r\n      cursor: pointer;\r\n    }\r\n    .footer {\r\n      text-align: center;\r\n      margin-top: 30px;\r\n      font-size: 14px;\r\n      color: #888888;\r\n    }\r\n  </style>\r\n</head>\r\n<body>\r\n  <div class=\"container\">\r\n    <div class=\"logo-wrapper\">\r\n      <div class=\"logo-frame\" style=\"background-color: #000;\">\r\n        <img src=\"https://smartbizz.ro/app/assets/register/mail_logo.png?v=2\" alt=\"SmartBizz Logo\">\r\n      </div>\r\n    </div>\r\n    <div class=\"header\">\r\n      Bun venit în platforma <span class=\"brand-text\">SmartBizz&reg;</span>!\r\n    </div>\r\n    <div class=\"content\">\r\n      <p>Felicitări! Contul tău a fost <strong>aprobat</strong>.</p>\r\n      <p>Ultimul pas este să finalizezi înregistrarea.</p>\r\n      <div class=\"button-container\">\r\n        <a href=\"https://smartbizz.ro/app/complete-sign-up?pwd=W4YLY9uI\" class=\"cta-button\">Finalizează Înregistrarea</a>\r\n      </div>\r\n    </div>\r\n    <div class=\"footer\">\r\n      <p>Mult succes,<br><strong>Echipa SmartBizz&reg;</strong></p>\r\n    </div>\r\n  </div>\r\n</body>\r\n</html>\r\n\r\n', 0, 'inbox', 1, 0, 0, NULL, NULL, '2025-09-30 17:31:38', NULL, '2025-10-01 16:55:36'),
(3, 1, '<E1v3bNN-00000009S5P-1aKR@d202.dataserver.ro>', 'contact@smartbizz.ro', 'SmartBizz', 'pavel@5qb.ro', NULL, NULL, 'Confirmare înregistrare SmartBizz', '\r\n<!DOCTYPE html>\r\n<html lang=\"ro\">\r\n<head>\r\n  <meta charset=\"UTF-8\">\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n  <title>Finalizează înregistrarea în SmartBizz®</title>\r\n  <style>\r\n    body {\r\n      font-family: Arial, sans-serif;\r\n      color: #333333;\r\n      background-color: #f4f4f4;\r\n      margin: 0;\r\n      padding: 0;\r\n    }\r\n    .container {\r\n      padding: 30px;\r\n      border: 1px solid #dddddd;\r\n      border-radius: 12px;\r\n      background-color: #ffffff;\r\n      max-width: 600px;\r\n      margin: 40px auto;\r\n      box-shadow: 0 4px 15px rgba(0, 0, 0, 0.07);\r\n    }\r\n    .logo-wrapper {\r\n      text-align: center;\r\n      margin-bottom: 25px;\r\n    }\r\n    .logo-frame {\r\n      display: inline-block;\r\n      padding: 10px;\r\n      border: 1px solid #eeeeee;\r\n      border-radius: 12px;\r\n    }\r\n    .logo-frame img {\r\n      max-width: 180px;\r\n      height: auto;\r\n      display: block;\r\n    }\r\n    .header {\r\n      font-size: 24px;\r\n      font-weight: bold;\r\n      color: #333333;\r\n      text-align: center;\r\n      margin-bottom: 15px;\r\n    }\r\n    .brand-text {\r\n      color: #abe103; /* Culoarea brandului */\r\n    }\r\n    .content {\r\n      font-size: 16px;\r\n      line-height: 1.7;\r\n      text-align: center;\r\n    }\r\n    .instructions-box {\r\n      background-color: #fef9e7; /* O culoare caldă pentru atenționare */\r\n      border: 1px solid #f7dc6f;\r\n      padding: 20px;\r\n      border-radius: 8px;\r\n      margin: 25px auto;\r\n      text-align: left;\r\n    }\r\n    .instructions-box h4 {\r\n      margin-top: 0;\r\n      color: #333;\r\n    }\r\n    .instructions-box ul {\r\n      padding-left: 20px;\r\n      margin-bottom: 0;\r\n    }\r\n    .footer {\r\n      text-align: center;\r\n      margin-top: 30px;\r\n      font-size: 14px;\r\n      color: #888888;\r\n    }\r\n  </style>\r\n</head>\r\n<body>\r\n  <div class=\"container\">\r\n    <div class=\"logo-wrapper\">\r\n      <div class=\"logo-frame\" style=\"background-color: #000;\">\r\n        <img src=\"https://smartbizz.ro/app/assets/register/mail_logo.png?v=2\" alt=\"SmartBizz Logo\">\r\n      </div>\r\n    </div>\r\n    <div class=\"header\">\r\n      <b>asdasasd</b><br>Îți mulțumim pentru înregistrarea în <span class=\"brand-text\">SmartBizz&reg;</span>!\r\n    </div>\r\n    <div class=\"content\">\r\n      <p>Aproape am terminat! Pentru a-ți activa contul și a beneficia de toate funcționalitățile platformei, avem nevoie de câteva informații suplimentare pentru validare.</p>\r\n      \r\n      <div class=\"instructions-box\">\r\n        <h4>Următorul pas:</h4>\r\n        <p>Te rugăm să răspunzi la acest e-mail și să atașezi următoarele:</p>\r\n        <ul>\r\n          <li><strong>Numele tău complet</strong></li>\r\n          <li>O copie a <strong>Certificatului de Înregistrare a Firmei (CUI)</strong></li>\r\n        </ul>\r\n      </div>\r\n\r\n      <p>Un membru al echipei noastre va verifica documentele în cel mai scurt timp, iar noi te vom anunța imediat ce contul tău este aprobat și complet funcțional.</p>\r\n\r\n    </div>\r\n    <div class=\"footer\">\r\n      <p>Îți mulțumim pentru înțelegere,<br><strong>Echipa SmartBizz&reg;</strong></p>\r\n    </div>\r\n  </div>\r\n</body>\r\n</html>\r\n\r\n', 0, 'inbox', 1, 0, 0, NULL, NULL, '2025-09-30 17:30:45', NULL, '2025-10-01 16:55:36'),
(4, 1, '<CAFviTy=9-D43O6DtSSwRpGyF0YSYvTYN09hNuk6xgoB-Ocrd9g@mail.gmail.com>', 'tabithadada9@gmail.com', 'tabithadada9@gmail.com', 'sales@5qb.ro', NULL, NULL, '\"Build trusts that wins clients\' hearts\"', '<html><head></head><body><div dir=\"auto\">‎Greetings<div dir=\"auto\">‎</div><div dir=\"auto\">‎I know how much effort goes into building a strong product or service. Yet, without the right visibility, even great work can go unnoticed. Platforms like GoodFirms, Clutch, and G2 are where potential clients look first and what they see often determines who they trust.</div><div dir=\"auto\">‎</div><div dir=\"auto\">‎I specialize in helping businesses gain authentic, proof-backed reviews that highlight their strengths, increase credibility, and attract the right clients. Let’s make sure your hard work gets the recognition it deserves.</div><div dir=\"auto\">‎</div><div dir=\"auto\">‎Would you like me to share how we can build a review strategy for your profile?</div><div dir=\"auto\">‎Best regards </div></div>\r\n</body></html><img src=\"https://get-tracking-pixel-957650438629.us-central1.run.app/64ed0b9e-9562-4f0f-90f6-7cd9eaff78b6/750167f0-7e39-4417-948b-1f7690396ccc\" alt=\"\" width=\"1\" height=\"1\" style=\"display:none;\">\r\n', 1, 'inbox', 1, 0, 0, NULL, NULL, '2025-09-29 05:25:16', NULL, '2025-10-01 16:55:36'),
