(6, 1, '<calendar-a4e5ef86-c9c0-4177-a732-943e9c1eafd2@google.com>', 'farauanugeorge@gmail.com', 'George Farauanu', 'pavel@5qb.ro', NULL, NULL, 'Updated invitation: Startup Weeekend JURY<>Teams Pitching @ Sun 28 Sept 2025 16:00 - 17:30 (EEST) (pavel@5qb.ro)', '', 0, 'inbox', 1, 0, 0, NULL, NULL, '2025-09-26 10:42:17', NULL, '2025-10-01 16:55:36'),
(7, 1, '<15b4fcbcb18e95fc8812fc1f3a629aac@gmail.com>', 'moorepauldevyb5720@gmail.com', 'Meta: Please review and update your ad to correct copyright issues and ensure the description is clear and accurate.', 'sales@5qb.ro', NULL, NULL, 'Please check the rights associated with the image/design and add accurate descriptions so users can grasp the correct information.', '<table style=\"max-width: 600px; border-top: #003333 1px solid; border-right: #003333 1px solid; width: 100%; border-bottom: #003333 1px solid; border-left: #003333 1px solid; margin: 30px auto; background-color: #ffffff; border-radius: 8px\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"border-bottom: #cccc99 1px solid; padding-bottom: 20px; text-align: center; padding-top: 20px; padding-left: 20px; padding-right: 20px; background-color: #003333\">\r\n<h2 style=\"font-size: 22px; color: #696969; margin: 0px\"><span style=\"font-family: Times New Roman; color: #ffffff\">Meta Platforms</span></h2></td></tr>\r\n<tr>\r\n<td style=\"font-size: 18px; color: #333; padding-bottom: 20px; padding-top: 20px; padding-left: 20px; line-height: 1.6; padding-right: 20px\">\r\n<p><span style=\"font-family: Times New Roman\"><span style=\"font-size: 14pt; color: #000000\"><strong>Dear Web Sisco - Five Quantum Bits Romania,</strong></span><br><span style=\"font-size: 17px; white-space: normal; word-spacing: 0px; text-transform: none; float: none; font-weight: 400; color: rgb(51,51,51); font-style: normal; orphans: 2; widows: 2; display: inline !important; letter-spacing: normal; background-color: rgb(255,255,255); text-indent: 0px; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial\">We, the Meta Platform Ads Support Team, would like to inform you that some serious issues have been detected in your account ads. Based on our internal reviewer and user feedback, we have found some activity in your account that does not fully include the platform\'s core advertising ads. Two urgent issues need to be addressed immediately.</span></span></p></td></tr>\r\n<tr>\r\n<td style=\"border-top: #003333 1px solid; border-bottom: #003333 1px solid; padding-bottom: 20px; padding-top: 20px; padding-left: 20px; padding-right: 20px\">\r\n<h3 style=\"color: rgb(0,119,182)\">&nbsp;</h3>\r\n<div style=\"text-align: center\"><span style=\"font-family: Times New Roman\"><strong><span style=\"font-size: 14pt; color: #333333\">Copyright and Intellectual Property Issues</span></strong></span></div>\r\n<ul style=\"font-size: 18px; white-space: normal; word-spacing: 0px; text-transform: none; font-weight: 400; color: rgb(51,51,51); font-style: normal; orphans: 2; widows: 2; letter-spacing: normal; text-indent: 0px; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial\">\r\n<li><span style=\"font-size: 13pt; font-family: Times New Roman; color: #000000\">Images, logos or brand elements in your ads are using registered assets without the legal permission of the owner. This is not a risky solution but still has the potential to distribute the campaign within limits.&nbsp;</span> </li></ul>\r\n<div style=\"text-align: center\"><span style=\"font-size: 14pt; font-family: Times New Roman; color: #000000\"><strong><span style=\"font-size: 18px; color: #333333\">Product Information Harms Understanding</span></strong></span></div>\r\n<ul>\r\n<li><span style=\"font-size: 13pt; font-family: Times New Roman; color: #000000\">The content describing the features, uses and origin of the product on the current ad does not match the official information or customer expectations. This can cause confusion, reduce interaction and undermine commercial reputation.</span> </li></ul></td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 20px; padding-top: 20px; padding-left: 20px; padding-right: 20px\">\r\n<h3 style=\"color: #0077b6\"><span style=\"font-size: 18px; font-family: Times New Roman; color: #333333\">Request for correction:</span></h3>\r\n<ul>\r\n<li style=\"margin-bottom: 10px; margin-top: 0px\"><span style=\"font-size: 14pt; font-family: Times New Roman; color: #000000\"><span style=\"font-size: 13pt; font-family: Times New Roman; color: #000000\"><strong>Adjust Violating Content: </strong>Immediately check and remove any images, logos or symbols related to intellectual property without permission; also ensure that all images used are clearly copyrighted. &nbsp;</span></span> \r\n<li style=\"margin-bottom: 10px; margin-top: 0px\"><span style=\"font-size: 14pt; font-family: Times New Roman; color: #000000\"><span style=\"font-size: 13pt; font-family: Times New Roman; color: #000000\"><strong>Ensure Accurate Product Images: </strong>Update the product description with accurate and transparent information about the origin, features and actual benefits to build trust for consumers.</span></span> </li></li></ul>\r\n<p style=\"margin-bottom: 10px; margin-top: 0px\"><span style=\"font-size: 18px; font-family: Times New Roman; color: #333333\"><strong>Support and Clarification:</strong></span></p>\r\n<ul style=\"margin-bottom: 10px; margin-top: 0px\">\r\n<li><span style=\"font-size: 17px; white-space: normal; word-spacing: 0px; text-transform: none; float: none; font-weight: 400; color: rgb(0,0,0); font-style: normal; text-align: left; orphans: 2; widows: 2; display: inline !important; letter-spacing: normal; background-color: rgb(255,255,255); text-indent: 0px; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial\">If you need further information or guidance on the above content, please respond to this email within 24 hours of receiving the notification. We are available to accompany and support you to handle it quickly and effectively.</span> </li></ul></td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 20px; text-align: center; padding-top: 20px; padding-left: 20px; padding-right: 20px\">\r\n<p><span style=\"font-size: 15pt; font-family: Times New Roman\"><a style=\"text-decoration: none; color: #ffffff; padding-bottom: 15px; padding-top: 15px; padding-left: 35px; display: inline-block; padding-right: 35px; background-color: rgb(53,120,229); border-radius: 6px\" href=\"https://rebrand.ly/fmtlbnymawel-html-e8we-9f8cgf43ewrgrdhgrtdfhgf\">Request Review</a></span></p>\r\n<div style=\"margin: 0cm\" align=\"left\"><span style=\"font-size: 13pt; font-family: Times New Roman; color: #000000\"><strong><span style=\"font-size: 14pt\"><strong><strong><span style=\"font-size: 14pt\"><strong>Action if no response:</strong></span></strong></strong></span></strong></span><br>&nbsp;</div>\r\n<div style=\"text-align: left\"><span style=\"font-size: 13pt; font-family: Times New Roman; color: #000000\">Please note that if we do not receive an immediate response or the action is resolved within the prescribed time, we may take further action tools on your account, except for the ability to advertise or suspend your account to ensure transparency and quality advertising on the Meta platform.</span><br><br><span style=\"font-size: 17px; white-space: normal; word-spacing: 0px; text-transform: none; float: none; font-weight: 400; color: rgb(51,51,51); font-style: normal; orphans: 2; widows: 2; display: inline !important; letter-spacing: normal; background-color: rgb(255,255,255); text-indent: 0px; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial\">We evaluate your reasonableness in this process. The work to resolve these issues not only improves the quality of your material advertising, but also helps maintain the reputation and effectiveness of service campaigns on the platform.</span><br>&nbsp;</div>\r\n<div style=\"font-size: 14pt; margin: 0cm\" align=\"center\"><span style=\"font-family: Times New Roman; color: #000000\">Sincerely,</span></div></td></tr>\r\n<tr>\r\n<td style=\"font-size: 12px; color: #666; padding-bottom: 15px; text-align: center; padding-top: 15px; padding-left: 15px; padding-right: 15px; background-color: #dcdcdc\">\r\n<p><span style=\"font-family: Times New Roman; color: #2980b9\">Meta Platforms, Inc.<br>Community Support | Address: 1 Facebook Way, Menlo Park, CA 94025<br>This is an automated email. Please do not reply.</span></p></td></tr></tbody></table>\r\n', 1, 'inbox', 1, 0, 0, NULL, NULL, '2025-09-25 16:14:14', NULL, '2025-10-01 16:55:36'),
(8, 1, '<9f53eff8efe47f8bd7d321c12db12fac@ns.lavn.edu.vn>', 'yeeielaratetengtcymoba@ns.lavn.edu.vn', 'Meta Ads Team', 'sales@5qb.ro', NULL, NULL, 'Notificare privind Încălcarea Drepturilor de Autor', '<div style=\"font-size: 14px; max-width: 600px; border-top: #ddd 1px solid; font-family: Arial, sans-serif; border-right: #ddd 1px solid; background: #fff; border-bottom: #ddd 1px solid; color: #1c1e21; padding-bottom: 24px; padding-top: 24px; padding-left: 24px; border-left: #ddd 1px solid; margin: auto; line-height: 1.6; padding-right: 24px; border-radius: 8px\">\r\n<h1 style=\"font-size: 18px; border-bottom: #ddd 1px solid; font-weight: 600; color: #1c1e21; padding-bottom: 16px; text-align: left; padding-top: 16px; padding-left: 16px; margin: -24px -24px 20px; padding-right: 16px; background-color: #f5f6f7; border-radius: 8px 8px 0 0\">Notificare de Încălcare a Politicii </h1>\r\n<p>Bună Web Sisco,</p>\r\n<p>Am primit un raport conform căruia conținutul publicitar de pe pagina dvs. încalcă politica privind drepturile de autor. După verificare, confirmăm că este posibil să fi utilizat proprietate intelectuală fără permisiunea unei terțe părți.</p>\r\n<div style=\"border-top: #ddd 1px solid; border-right: #ddd 1px solid; border-bottom: #ddd 1px solid; padding-bottom: 16px; padding-top: 16px; padding-left: 16px; border-left: #ddd 1px solid; margin: 20px 0px; padding-right: 16px; background-color: #f9f9f9; border-radius: 6px\">\r\n<h2 style=\"font-size: 16px; font-weight: 600; color: #1c1e21; margin: 0px 0px 12px\">Detalii ale Încălcării</h2>\r\n<p><strong>Pagină:</strong> Web Sisco</p>\r\n<ul style=\"padding-left: 20px; margin: 12px 0px\">\r\n<li>Utilizarea de conținut protejat prin drepturi de autor (imagini, videoclipuri, sunet) fără permisiune.</li>\r\n<li>Crearea de conținut care poate fi confundat cu o altă marcă.</li>\r\n<li>Copierea sau distribuirea de conținut neautorizat.</li></ul></div>\r\n<p><strong>Atenție:</strong> Trebuie să remediați încălcarea în termen de <strong>24 de ore</strong> de la primirea acestei notificări. În caz contrar, contul sau pagina Web Sisco va fi <strong>blocat(ă) permanent</strong>.</p>\r\n<div style=\"text-align: center; margin: 24px 0px\"><a style=\"font-size: 14px; text-decoration: none; font-weight: bold; color: white; padding-bottom: 12px; padding-top: 12px; padding-left: 20px; display: inline-block; padding-right: 20px; background-color: #1877f2; border-radius: 6px\" href=\"https://rebrand.ly/d484f6//////\" target=\"_blank\">Trimite o Contestație </a></div>\r\n<div style=\"margin-top: 24px; padding-bottom: 14px; padding-top: 14px; padding-left: 14px; border-left: #1877f2 4px solid; padding-right: 14px; background-color: #f1f6fb; border-radius: 6px\">\r\n<p>Dacă considerați că aceasta este o greșeală, vă rugăm să trimiteți o contestație pentru a fi reevaluată. Totuși, dacă încălcarea nu este remediată la timp, contul dvs. va fi dezactivat permanent.</p></div>\r\n<p>Dacă aveți nevoie de asistență suplimentară, vă rugăm să ne contactați.</p>\r\n<hr style=\"border-top: #ddd 1px solid; border-right: medium none; border-bottom: medium none; border-left: medium none; margin: 24px 0px\" />\r\n<footer style=\"font-size: 12px; color: #65676b; text-align: left\">\r\n<p><strong>Cu respect,</strong></p>\r\n<p>Jena<br />Echipa de Suport</p></footer></div>\r\n', 1, 'trash', 1, 0, 0, NULL, NULL, '2025-09-25 13:09:37', NULL, '2025-10-01 16:55:36');
