(9, 1, '<383581642.444434.1758775870360@mail.yahoo.com>', 'parjeamarius@yahoo.com', 'Marius Parjea', 'pavel@5qb.ro', NULL, NULL, 'Re: Buna ziua', '<html><head></head><body><div class=\"ydp10d37554yahoo-style-wrap\" style=\"font-family:Helvetica Neue, Helvetica, Arial, sans-serif;font-size:16px;\"><div><div dir=\"ltr\" data-setdir=\"false\">Buna dimineata Pavel,</div><div dir=\"ltr\" data-setdir=\"false\">Saptamana aceasta si viitoare, suntem un pic plecati de la birou, dar dupa ce revenim, o sa vin cu mai multe detalii.</div><div dir=\"ltr\" data-setdir=\"false\">Oferta de la care putem incepe discutia, este interesanta.</div><div dir=\"ltr\" data-setdir=\"false\">Multumesc.<br></div><div><br></div><div class=\"ydp10d37554signature\">Cu respect,&nbsp;</div><div class=\"ydp10d37554signature\">Marius Parjea&nbsp;</div><div class=\"ydp10d37554signature\">Tel:0753 795 528&nbsp;</div><div class=\"ydp10d37554signature\">E-mail:parjeamarius@yahoo.com</div></div>\r\n        <div><br></div><div><br></div>\r\n        \r\n        </div><div id=\"yahoo_quoted_9093650087\" class=\"yahoo_quoted\">\r\n            <div style=\"font-family:\'Helvetica Neue\', Helvetica, Arial, sans-serif;font-size:13px;color:#26282a;\">\r\n                \r\n                <div>\r\n                        On Wednesday, September 24, 2025 at 01:14:51 PM GMT+3,  &lt;pavel@5qb.ro&gt; wrote:\r\n                    </div>\r\n                    <div><br></div>\r\n                    <div><br></div>\r\n                \r\n                \r\n                <div><div id=\"yiv0071505856\"><style><!--\r\n\r\n#yiv0071505856 filtered {}\r\n#yiv0071505856 filtered {}\r\n#yiv0071505856 filtered {}\r\n#yiv0071505856 filtered {}\r\n#yiv0071505856 filtered {}\r\n#yiv0071505856 filtered {}\r\n#yiv0071505856 filtered {}\r\n\r\n#yiv0071505856 p.yiv0071505856MsoNormal, #yiv0071505856 li.yiv0071505856MsoNormal, #yiv0071505856 div.yiv0071505856MsoNormal\r\n	{margin:0in;font-size:12.0pt;font-family:\"Aptos\", sans-seri