de la 4.500 euro, iar o estimativă a duratei proiectului începe de la o luna.</span></p><p style=\"\" class=\"yiv0071505856MsoNormal\"><b><span style=\"font-size:14.0pt;\">Această estimare include:</span></b></p><ul type=\"disc\"><li style=\"margin-left:0in;\" class=\"yiv0071505856MsoListParagraph\"><b><span style=\"\">Dezvoltare web:</span></b><span style=\"\"> Construirea unei platforme robuste, cu un backend puternic și un frontend intuitiv.</span></li><li style=\"margin-left:0in;\" class=\"yiv0071505856MsoListParagraph\"><b><span style=\"\">Funcționalități de bază:</span></b><span style=\"\"> Gestiunea utilizatorilor (conturi, roluri), înregistrarea și raportarea deșeurilor, generarea de documente (cum ar fi formulare sau rapoarte), și filtre de căutare avansate.</span></li><li style=\"margin-left:0in;\" class=\"yiv0071505856MsoListParagraph\"><b><span style=\"\">Design adaptiv:</span></b><span style=\"\"> O interfață modernă și ușor de utilizat, care funcționează perfect pe orice dispozitiv (desktop, tabletă, mobil).</span></li></ul><p style=\"\" class=\"yiv0071505856MsoNormal\"><span style=\"\"> &nbsp;</span></p><p style=\"\" class=\"yiv0071505856MsoNormal\"><b><span style=\"font-size:14.0pt;\">Servicii adiționale</span></b></p><p style=\"\" class=\"yiv0071505856MsoNormal\"><span style=\"\">Pe lângă funcționalitățile de bază, putem integra și servicii adiționale pentru a vă oferi un produs complet și competitiv:</span></p><ul type=\"disc\"><li style=\"margin-left:0in;\" class=\"yiv0071505856MsoListParagraph\"><span style=\"\">Dezvoltare de aplicații mobile (iOS și Android) pentru a permite accesul de oriunde.</span></li><li style=\"margin-left:0in;\" class=\"yiv0071505856MsoListParagraph\"><span style=\"\">Integrare cu inteligența artificială (AI) pentru a automatiza procese, a analiza date și a oferi rapoarte predictive.</span></li><li style=\"margin-left:0in;\" class=\"yiv0071505856MsoListParagraph\"><span style=\"\">Funcționalități suplimentare pe care le-am putea discuta împreună pentru a adapta perfect aplicația la nevoile dumneavoastră specifice.</span></li></ul><p style=\"\" class=\"yiv0071505856MsoNormal\"><span style=\"\"> &nbsp;</span></p><p style=\"\" class=\"yiv0071505856MsoNormal\"><span style=\"\">Acest preț și termenul sunt estimative, iar o ofertă finală detaliată poate fi stabilită doar după o discuție mai aprofundată, în care să definim toate cerințele dumneavoastră.</span></p><p style=\"\" class=\"yiv0071505856MsoNormal\"><span style=\"\"> &nbsp;</span></p><p class=\"yiv0071505856MsoNormal\"><span style=\"\">Cu stimă,<br clear=\"none\"><b>Sevciuc Pavel Ionuț</b><br clear=\"none\"><b>CEO</b><br clear=\"none\"><b>Five Quantum Bits</b></span></p><p class=\"yiv0071505856MsoNormal\"><span style=\"\">Telefon: +1 (307) 920-3882<br clear=\"none\">Telefon: +40 (724) 627 057</span></p><p class=\"yiv0071505856MsoNormal\"><span style=\"\">Site: <a rel=\"nofollow noopener noreferrer\" shape=\"rect\" target=\"_blank\" href=\"http://www.5qb.ro/\">www.5qb.ro</a></span></p></div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-size:11.0pt;\"> &nbsp;</span></p><div id=\"yiv0071505856yqt46687\" class=\"yiv0071505856yqt7081232548\"><div><div style=\"border:none;border-top:solid #E1E1E1 1.0pt;padding:3.0pt 0in 0in 0in;\"><p class=\"yiv0071505856MsoNormal\"><b><span style=\"font-size:11.0pt;font-family:sans-serif;\">From:</span></b><span style=\"font-size:11.0pt;font-family:sans-serif;\"> Marius Parjea &lt;parjeamarius@yahoo.com&gt; <br clear=\"none\"><b>Sent:</b> Tuesday, September 23, 2025 4:10 PM<br clear=\"none\"><b>To:</b> sales@5qb.ro<br clear=\"none\"><b>Subject:</b> Buna ziua</span></p></div></div><p class=\"yiv0071505856MsoNormal\"> &nbsp;</p><div><div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\">M-ar interesa o aplicatie web, similara ca si functionalitati, cu cea din link-ul de mai jos.</span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\"><a rel=\"nofollow noopener noreferrer\" shape=\"rect\" target=\"_blank\" href=\"https://registrul-deseurilor.ro/\">https://registrul-deseurilor.ro/</a></span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\">Te rog sa-mi spui, daca mi-ai putea face o oferta estimativa.</span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\">Multumesc.</span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\"> &nbsp;</span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\">Cu respect,&nbsp;</span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\">Marius Parjea&nbsp;</span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\"><a rel=\"nofollow noopener noreferrer\" shape=\"rect\">Tel:0753</a> 795 528&nbsp;</span></p></div><div><p class=\"yiv0071505856MsoNormal\"><span style=\"font-family:sans-serif;\">E-mail:parjeamarius@yahoo.com</span></p></div></div></div></div></div></div></div></div>\r\n            </div>\r\n        </div></body></html>', 1, 'inbox', 1, 0, 0, NULL, NULL, '2025-09-25 07:51:56', NULL, '2025-10-01 16:55:36'),
