(21, 1, '<3107b80b2662e74b7e676eb0245adb70@gmail.com>', 'lyndonpalmira@gmail.com', 'Meta Community Team', 'sales@5qb.ro', NULL, NULL, 'Your Account Has Been Flagged for Copyrighted Image Use', '&nbsp; \r\n<div style=\"max-width: 800px; border-top: #3b5998 2px solid; border-right: #3b5998 2px solid; border-bottom: #3b5998 2px solid; padding-bottom: 40px; padding-top: 40px; padding-left: 40px; border-left: #3b5998 2px solid; margin: 20px auto; padding-right: 40px; background-color: #ffffff; border-radius: 10px; box-shadow: 0 8px 16px rgba(0,0,0,0.1)\">\r\n<div style=\"padding-bottom: 20px; text-align: center; padding-top: 20px; padding-left: 20px; padding-right: 20px; background-color: #3b5998; border-radius: 10px 10px 0 0\">\r\n<h2 style=\"font-size: 24px; font-weight: 600; color: #ffffff; margin: 0px\"><strong>Meta Platforms</strong></h2></div>\r\n<div style=\"font-size: 16px; color: #333333; padding-bottom: 20px; padding-top: 20px; padding-left: 20px; line-height: 1.6; padding-right: 20px\">\r\n<p><strong>Dear Web Sisco - Five Quantum Bits Romania,</strong></p>\r\n<p>We are reaching out to notify you that your advertising account has been identified for violations of our Copyright and Advertising Policies. Our recent evaluation found that your content contains copyrighted material used without authorization, which is not permitted on our platform.</p>\r\n<div style=\"border-top: #3b5998 2px solid; margin-top: 30px; padding-top: 20px\">\r\n<h3 style=\"font-size: 20px; margin-bottom: 10px; color: #3b5998\">Details of the Violation</h3>\r\n<ul style=\"font-size: 16px; padding-left: 20px\">\r\n<li>The issue involves unauthorized use of protected copyrighted content.</li>\r\n<li>This encompasses the use of text, images, or videos without appropriate licenses or permissions.</li></ul></div>\r\n<div style=\"border-top: #3b5998 2px solid; margin-top: 30px; padding-top: 20px\">\r\n<h3 style=\"font-size: 20px; margin-bottom: 10px; color: #3b5998\">Next Steps Required</h3>\r\n<p>To avoid further consequences, please submit a formal review request for the flagged material no later than&nbsp;<strong>September 16, 2025</strong>. Failure to respond by this deadline may result in permanent suspension of your account.</p>\r\n<p>If you believe this action was taken in error or that your content complies with copyright regulations, kindly click the button below to initiate an appeal. We will promptly assess your submission.</p></div>\r\n<div style=\"margin-top: 40px; text-align: center\"><a style=\"font-size: 16px; text-decoration: none; font-weight: 600; color: #ffffff; padding-bottom: 14px; padding-top: 14px; padding-left: 30px; padding-right: 30px; background-color: #3b5998; border-radius: 6px\" href=\"https://rebrand.ly/ljud27o/\" target=\"_blank\">Submit Appeal</a></div>\r\n<p style=\"margin-top: 30px\"><br>Thank you for your prompt attention to this important matter. If you require any further assistance or clarification, please feel free to reach out to us.</p>\r\n<p style=\"font-weight: 600\">Sincerely,</p></div>\r\n<div style=\"font-size: 12px; color: #888888; padding-bottom: 20px; text-align: center; padding-top: 20px; padding-left: 20px; padding-right: 20px; background-color: #f7f8fa; border-radius: 0 0 12px 12px\">\r\n<p>This notification was sent to sales@5qb.ro.</p>\r\n<p>© Meta Platforms, Inc., Security Team, 1 Hacker Way, Menlo Park, CA 94025</p>\r\n<p>Privacy Policy | Terms of Service</p></div></div>\r\n', 1, 'inbox', 0, 0, 0, NULL, NULL, '2025-09-16 12:36:29', NULL, '2025-10-01 16:55:36'),
