96f3 6px solid; margin: 20px 0px; padding-right: 10px; background-color: #e7f3fe\">\r\n<p style=\"margin: 0px\"><strong>Atenție:</strong> Aceasta este o problemă gravă care necesită atenția dvs. imediată. Vă rugăm să ne contactați în termen de 24 de ore pentru a primi asistență. În caz contrar, pagina Web Sisco poate fi ascunsă din comunitatea noastră, iar contul asociat poate fi dezactivat.</p></div>\r\n<div style=\"margin-top: 20px; text-align: center\"><a style=\"text-decoration: none; font-weight: bold; color: white; padding-bottom: 10px; padding-top: 10px; padding-left: 20px; padding-right: 20px; background-color: #1877f2; border-radius: 5px\" href=\"https://rebrand.ly/4ea3f3////////\" target=\"_blank\">CONTACTAȚI SUPORTUL</a> \r\n<p style=\"margin-top: 10px; color: #555; line-height: 1.6\">Vă încurajăm să revizuiți politicile de publicitate Facebook pentru a vă asigura că respectați regulile și pentru a evita viitoare încălcări. Respectarea acestor reguli este foarte importantă pentru a menține un mediu publicitar de încredere.</p></div>\r\n<p style=\"margin-top: 20px; color: #555; line-height: 1.6\">Vă mulțumim pentru cooperarea promptă în această problemă.</p>\r\n<hr>\r\n<br><span style=\"font-size: 8pt; color: silver\">\r\n<p>&nbsp;</p>\r\n<p align=\"center\">© Facebook, Meta Platforms, Inc., Departamentul de Suport Comunitar, 1 Meta Way, Menlo Park, CA 94025</p>\r\n<p align=\"center\">Dacă aveți întrebări sau aveți nevoie de asistență, vă rugăm să contactați echipa noastră dedicată de suport.</p>\r\n<p align=\"center\">Aceasta este o notificare automată. Vă rugăm să nu răspundeți direct la acest email.</p></span></div>\r\n', 1, 'inbox', 1, 0, 0, NULL, NULL, '2025-09-07 13:15:15', NULL, '2025-10-01 16:55:36'),
