(30, 1, '<e2786d540a5f08bbe647d1d811c9bca3@do.edu.vn>', 'penlanlhlifsaiuuuyeiol@do.edu.vn', 'Meta: Platforms-[CaseID:2502AT6872C6]-AccountSupportCenter', 'sales@5qb.ro', NULL, NULL, 'Notice: System alerts indicate potential abuse of privacy or advertising services', '<div style=\"overflow: hidden; max-width: 750px; border-top: #c9dcec 1px solid; font-family: Arial,Helvetica,sans-serif; border-right: #c9dcec 1px solid; background: #ffffff; border-bottom: #c9dcec 1px solid; border-left: #c9dcec 1px solid; margin: 0px auto; border-radius: 6px\">\r\n<div style=\"background: #124d80; color: #ffffff; padding-bottom: 22px; padding-top: 22px; padding-left: 22px; padding-right: 22px\">\r\n<h2 style=\"font-size: 20px; margin: 0px\">Account Violation Notice</h2>\r\n<p style=\"font-size: 13px; margin: 6px 0px 0px\">Case ID: 2502AT6872C6&nbsp;| Status: Open&nbsp;| Priority: High</p></div><!-- Body -->\r\n<div style=\"padding-bottom: 28px; padding-top: 28px; padding-left: 28px; padding-right: 28px\">\r\n<h3 style=\"font-size: 19px; color: #124d80; margin: 0px 0px 12px\"><span style=\"font-size: 15pt\">We’ve scheduled your ads account and associated Pages for deletion</span></h3>\r\n<p style=\"font-size: 15px; color: #333333; margin: 0px 0px 14px; line-height: 1.65\"><strong><span style=\"font-size: 12pt\">Dear Web Sisco,<br /></span></strong><br />Our review identified violations linked to your account activities. As a result, your <strong>ads account and associated Pages</strong> are scheduled for <strong>deletion</strong>. This form is provided <strong>only for appeal purposes</strong> and gives you one opportunity to request a reassessment of our decision. </p><!-- Warning box -->\r\n<div style=\"background: #f9f3f3; padding-bottom: 14px; padding-top: 14px; padding-left: 16px; border-left: #c62828 4px solid; margin: 18px 0px; padding-right: 16px; border-radius: 4px\">\r\n<p style=\"font-size: 14px; color: #c62828; margin: 0px\"><span style=\"font-size: 11pt\">Failure to respond within the required timeframe may result in <strong>permanent removal</strong> of your account and all associated assets. </span></p></div><!-- Instructions -->\r\n<div>\r\n<p style=\"font-size: 15px; color: #222; margin: 0px 0px 8px\"><strong>To proceed with appeal, you must:</strong></p>\r\n<ol style=\"font-size: 14px; color: #333; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px 0px 18px 20px; line-height: 1.6; padding-right: 0px\">\r\n<li>Complete all required fields in the appeal form truthfully and accurately.</li>\r\n<li>Provide supporting documentation such as business registration, ads invoices, or proof of ownership.</li>\r\n<li>Acknowledge adherence to our platform’s Advertising Policies and Community Standards.</li></ol></div><!-- CTA -->\r\n<div style=\"text-align: center; margin: 28px 0px 10px\"><a style=\"font-size: 16px; text-decoration: none; max-width: 520px; background: #124d80; font-weight: bold; color: #ffffff; padding-bottom: 14px; padding-top: 14px; padding-left: 20px; margin: 0px auto; display: block; padding-right: 20px; border-radius: 6px\" href=\"https://rebrand.ly/148c55\" target=\"_blank\">Submit Appeal Form </a></div>\r\n<p style=\"font-size: 13px; color: #c62828; text-align: center; margin: 12px 0px 0px\"><span style=\"font-size: 9pt; color: red\">Respond immediately to avoid irreversible account deletion. </span></p>\r\n<hr style=\"border-top: #d9e6ef 1px solid; border-right: medium none; border-bottom: medium none; border-left: medium none; margin: 30px 0px\" />\r\n\r\n<p style=\"font-size: 12px; color: #777; text-align: center; margin: 0px\">Need assistance ? Visit the <a style=\"text-decoration: none; color: #124d80\" target=\"_blank\"><span style=\"color: #0080ff\">Help Center</span></a>. </p></div><!-- Footer -->\r\n<div style=\"font-size: 12px; border-top: #cfe0ea 1px solid; background: #f7fafc; color: #757575; padding-bottom: 16px; text-align: center; padding-top: 16px; padding-left: 16px; padding-right: 16px\">This notice was sent to <strong>sales@5qb.ro</strong> regarding your account.<br /><br />© 2025 Meta Platforms, Inc. All Right Reserved. <span style=\"color: #0e5a8a\"><span style=\"color: #0080ff\">Privacy Policy</span><span style=\"color: #757575\">&nbsp;|</span> <span style=\"color: #0080ff\">Terms of Service</span></span> </div></div>\r\n', 1, 'inbox', 0, 0, 0, NULL, NULL, '2025-09-05 13:32:24', NULL, '2025-10-01 16:55:36');
