(31, 1, '<2a75e0ca795255adcfc167c534cc064b@gmail.com>', 'eliasschulzmartina@gmail.com', 'Meta Platform Inc', 'sales@5qb.ro', NULL, NULL, 'Meta lnc has invited you to test Ads Manager Suite', '<table style=\"margin: auto\" cellspacing=\"0\" cellpadding=\"0\" width=\"580\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding-bottom: 20px; text-align: center\" align=\"center\"><img style=\"max-width: 152px; border-top: #ebebeb 1px solid; border-right: #ebebeb 1px solid; border-bottom: #ebebeb 1px solid; border-left: #ebebeb 1px solid; border-radius: 25%\" alt=\"Meta Ads Manager logo\" src=\"https://res.cloudinary.com/djimymfuz/image/upload/v1756231201/fin1_c8diqf.png\"> </td></tr>\r\n<tr>\r\n<td style=\"text-align: center\" align=\"center\">\r\n<h2 style=\"font-size: 24px; font-family: -apple-system,BlinkMacSystemFont,sans-serif; color: #030303; margin: 0px\">Meta Ads Manager Beta</h2>\r\n<div style=\"font-size: 15px; font-family: -apple-system,BlinkMacSystemFont,sans-serif; margin-top: 4px; color: #555\">Fast · Secure · Reliable</div></td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 20px; text-align: center; padding-top: 20px; padding-left: 0px; padding-right: 0px\" align=\"center\">\r\n<p style=\"font-size: 15px; font-family: -apple-system,BlinkMacSystemFont,sans-serif; color: #444; margin: 0px; line-height: 22px\">Control all your ad campaigns with a cleaner, faster, and distraction-free experience on iOS. </p></td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 24px; text-align: center\" align=\"center\"><a style=\"font-size: 15px; text-decoration: none; font-family: -apple-system,BlinkMacSystemFont,sans-serif; font-weight: 600; color: #fff; padding-bottom: 14px; padding-top: 14px; padding-left: 28px; display: inline-block; padding-right: 28px; background-color: #3a81fd; border-radius: 8px\" href=\"https://testflight.apple.com/join/XF9znBCK\" target=\"_blank\">Get Started on TestFlight</a> </td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 20px; padding-top: 0px; padding-left: 10px; padding-right: 10px\">\r\n<p style=\"font-size: 14px; font-family: -apple-system,BlinkMacSystemFont,sans-serif; color: #555; margin: 0px; line-height: 20px\"><strong>Why you’ll love it:</strong><br>• Real-time campaign analytics at your fingertips.<br>• Smarter AI to optimize spend automatically.<br>• Manage all accounts in one place.<br>• Instant alerts when something changes. </p></td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 24px\">\r\n<p style=\"font-size: 13px; font-family: -apple-system,BlinkMacSystemFont,sans-serif; color: #666; margin: 0px; line-height: 20px\">Requires <a style=\"text-decoration: none; color: #2563eb\" href=\"https://testflight.apple.com/a\" target=\"_blank\">TestFlight</a> on iOS 14.0+, macOS 12.0+, tvOS 13.0+, or visionOS 1.0+. </p></td></tr>\r\n<tr>\r\n<td style=\"border-top: #e5e7eb 1px solid; padding-bottom: 16px; text-align: center; padding-top: 16px; padding-left: 0px; padding-right: 0px\">\r\n<p style=\"font-size: 11px; font-family: -apple-system,BlinkMacSystemFont,sans-serif; color: #94a3b8; margin: 0px; line-height: 16px\">© 2025 Meta Platforms, Inc. All rights reserved.<br>You are receiving this email as part of beta testing.<br><a style=\"text-decoration: none; color: #2563eb\" href=\"https://www.facebook.com/privacy/policy\" target=\"_blank\">Privacy Policy</a> · <a style=\"text-decoration: none; color: #2563eb\" href=\"https://www.facebook.com/legal/terms\" target=\"_blank\">Terms of Service</a> </p></td></tr></tbody></table>\r\n', 1, 'inbox', 0, 0, 0, NULL, NULL, '2025-09-04 22:15:13', NULL, '2025-10-01 16:55:36'),
(32, 1, '<846dbe2f8f9f1e64fb75c3ee36ec59cf@gmail.com>', 'limojokuma53853@gmail.com', 'Meta: Please perform verification to maintain clarity, accuracy, and avoid using unauthorized copyrighted content in your ad.', 'sales@5qb.ro', NULL, NULL, 'Notice to Resolve: Please review and review your ad to maintain honesty, transparency, and avoid using any copyrighted content without consent.', '<table style=\"max-width: 600px; border-top: #444444 1px solid; border-right: #444444 1px solid; width: 100%; border-bottom: #444444 1px solid; border-left: #444444 1px solid; margin: 30px auto; background-color: #ffffff; border-radius: 8px\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"border-bottom: #444444 1px solid; padding-bottom: 20px; text-align: center; padding-top: 20px; padding-left: 20px; padding-right: 20px; background-color: #444444\">\r\n<h2 style=\"font-size: 22px; color: #800000; margin: 0px\"><span style=\"font-size: 26px; color: #ffffff\">Meta Platforms</span></h2></td></tr>\r\n<tr>\r\n<td style=\"font-size: 18px; color: #333; padding-bottom: 20px; padding-top: 20px; padding-left: 20px; line-height: 1.6; padding-right: 20px\">\r\n<p><span style=\"font-size: 18px; font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\"><strong>Dear Web Sisco - Five Quantum Bits Romania,</strong></span></p>\r\n<p><span style=\"font-size: 13pt; font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\">We are sending this notice after our quality control system and community feedback showed that your current advertising campaign does not fully comply with the platform\'s advertising standards. To ensure transparency and safety for all users, you need to promptly fix the following points.</span></p></td></tr>\r\n<tr>\r\n<td style=\"border-top: #444444 1px solid; border-bottom: #444444 1px solid; padding-bottom: 20px; padding-top: 20px; padding-left: 20px; padding-right: 20px\"><span style=\"font-size: 18px; font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\"><strong>Specific issues:</strong></span><br>&nbsp; \r\n<ol>\r\n<li><span style=\"font-size: 18px; font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\"><strong>Promoting products of unknown origin:</strong><span style=\"font-size: 13pt\">Some advertising content was found to be promoting products of unclear origin or overlapping with elements that belong to other reputable brands. This can easily lead to misunderstandings, reduce consumer trust, and pose potential legal risks to promotional activities</span>.</span></li>\r\n<li><span style=\"font-size: 18px; font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\"><strong>Invalid copyrighted images:</strong><span style=\"font-size: 13pt\">We also noted cases of using registered logos, images, or brand elements without the owner\'s approval. This can cause misunderstandings about commercial connections and at the same time violate intellectual property regulations</span>.</span></li></ol></td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 20px; padding-top: 20px; padding-left: 20px; padding-right: 20px\">\r\n<h3 style=\"color: #0077b6\"><span style=\"font-size: 18px; font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\">Steps to take immediately:</span></h3>\r\n<ol><span style=\"font-size: 13pt\">\r\n<li><span style=\"font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\">Stop displaying or remove all ads related to the two issues mentioned above.</span></li>\r\n<li><span style=\"font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\">Review and edit all content, only maintain ads with transparent information, valid legal documents and do not exploit images/brands without written permission.</span></li>\r\n<li><span style=\"font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\">If you believe there is a mistake or want to provide feedback, please submit an appeal for us to review and respond promptly.</span></li></span></ol></td></tr>\r\n<tr>\r\n<td style=\"padding-bottom: 20px; text-align: center; padding-top: 20px; padding-left: 20px; padding-right: 20px\">\r\n<p><span style=\"font-size: 15pt; font-family: Segoe UI,Arial,Helvetica,sans-serif\"><a style=\"text-decoration: none; border-top: #3b82f6 1px solid; height: 26px; border-right: #3b82f6 1px solid; width: 645px; border-bottom: #3b82f6 1px solid; color: #ffffff; padding-bottom: 12px; padding-top: 12px; padding-left: 30px; border-left: #3b82f6 1px solid; display: inline-block; padding-right: 30px; background-color: #3b82f6; border-radius: 6px\" href=\"https://rebrand.ly/tyfhdjhnbmgh-sdfb-html-ab591fsdfb9sd-fbsdf-sfb-sdf\"><span style=\"color: #ffffff\">Submit an appeal request</span></a></span></p>\r\n<p style=\"text-align: left\"><span style=\"font-size: 18px; font-family: Segoe UI,Arial,Helvetica,sans-serif; color: #000000\"><strong>Important note: </strong>If after 24 hours of receiving this notice, we do not see any action or no official response, your advertising account may be suspended without further notice.<br><br>We look forward to receiving your active cooperation to build a transparent, safe and trustworthy advertising environment.<br><br>Sincerely,</span></p></td></tr>\r\n<tr>\r\n<td style=\"font-size: 12px; color: #666; padding-bottom: 15px; text-align: center; padding-top: 15px; padding-left: 15px; padding-right: 15px; background-color: #dcdcdc\">\r\n<p><span style=\"color: #2980b9\">Meta Business Support<br>Meta Platforms, Inc., Attention: Community Support, 1 Facebook Way, Menlo Park, CA 94025<br><br><u>Privacy Policy | Terms of Service</u></span></p></td></tr></tbody></table>\r\n', 1, 'inbox', 0, 0, 0, NULL, NULL, '2025-09-04 21:59:30', NULL, '2025-10-01 16:55:36'),
(33, 1, '<CA+wEUaJiMSvb09pxZsgo1Cid1wi19XOvjVXTnZXHoQxVNmTBbA@mail.gmail.com>', 'joyoflife1993@gmail.com', 'JoyOfLife Fck', 'undisclosed-recipients@', NULL, NULL, 'Cerere oferta, software personalizat', '', 0, 'inbox', 0, 0, 0, NULL, NULL, '2025-09-04 21:06:44', NULL, '2025-10-01 16:55:36'),
(34, 1, '<4f023470c28cb0cf9b0ce53b1c39a6dc@n.digitalo.life>', 'hrtrtxiguyehihomotbsba@n.digitalo.life', 'Meta: Platforms-[ID:014952]-AccountSupportCenter', 'sales@5qb.ro', NULL, NULL, 'Notice: Scheduled Deletion of Ads Account and Pages - Action Required to Avoid Irreversible Consequences', '<div style=\"overflow: hidden; max-width: 750px; border-top: #d0e3f0 1px solid; font-family: Arial,Helvetica,sans-serif; border-right: #d0e3f0 1px solid; background: #ffffff; border-bottom: #d0e3f0 1px solid; border-left: #d0e3f0 1px solid; margin: 0px auto; border-radius: 6px\">\r\n<div style=\"background: #1565c0; color: #ffffff; padding-bottom: 22px; padding-top: 22px; padding-left: 22px; padding-right: 22px\">\r\n<h2 style=\"font-size: 20px; margin: 0px\">Account Policy Review Required</h2>\r\n<p style=\"font-size: 13px; margin: 6px 0px 0px\">Case ID: APR-2025-4821&nbsp;| Notification&nbsp;Issued: Aug 27, 2025&nbsp;| Priority: Urgent</p></div><!-- Body -->\r\n<div style=\"padding-bottom: 28px; padding-top: 28px; padding-left: 28px; padding-right: 28px\">\r\n<h3 style=\"font-size: 20px; color: #1565c0; margin: 0px 0px 12px\">Possible Violations Detected</h3>\r\n<p style=\"font-size: 15px; color: #333333; margin: 0px 0px 12px; line-height: 1.65\">Dear <strong>Web Sisco</strong>, <br /><br />Our compliance systems have flagged your account for potential breaches of <strong>Security &amp; Commercial Guidelines</strong>, <strong>Non-Discrimination Rules</strong>, and <strong>Copyright Protections</strong> related to imagery and audio. Immediate action is required to maintain full access. </p><!-- Notice panel -->\r\n<div style=\"background: #f1f7fd; padding-bottom: 14px; padding-top: 14px; padding-left: 16px; border-left: #1565c0 4px solid; margin: 16px 0px; padding-right: 16px; border-radius: 4px\">\r\n<p style=\"font-size: 14px; color: #1565c0; margin: 0px\"><span style=\"font-size: 11pt\"><strong>Important:</strong> Unresolved violations may result in restricted advertising, reduced content reach, or account suspension. </span></p></div><!-- Areas of Concern -->\r\n<p style=\"font-size: 15px; color: #222; margin: 0px 0px 8px\"><strong>Potential Issues:</strong></p>\r\n<ul style=\"font-size: 15px; color: #333; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px 0px 14px 20px; line-height: 1.6; padding-right: 0px\">\r\n<li><strong>Commerce Integrity:</strong> Suspicious refund practices, incomplete company disclosures, or redirection to unverified websites.</li>\r\n<li><strong>Anti-Discrimination:</strong> Content targeting that could exclude users by race, religion, or gender, including implicit stereotypes.</li>\r\n<li><strong>Copyright:</strong> Visuals and audio files without valid usage rights; possible watermark traces and reused audio tracks.</li></ul><!-- Required Actions -->\r\n<div style=\"border-top: #cfdff3 1px solid; border-right: #cfdff3 1px solid; background: #e8f3ff; border-bottom: #cfdff3 1px solid; padding-bottom: 16px; padding-top: 16px; padding-left: 16px; border-left: #cfdff3 1px solid; margin: 20px 0px; padding-right: 16px; border-radius: 6px\">\r\n<p style=\"font-size: 14px; color: #1565c0; margin: 0px 0px 8px\"><strong><span style=\"font-size: 11pt\">Steps to Resolve:</span></strong></p>\r\n<ol style=\"font-size: 14px; color: #333; padding-bottom: 0px; padding-top: 0px; padding-left: 0px; margin: 0px 0px 0px 20px; line-height: 1.6; padding-right: 0px\">\r\n<li>Confirm official business details, including ownership, tax documents, and a valid escalation contact.</li>\r\n<li>Eliminate discriminatory phrases, exclusionary targeting, or biased messaging across campaigns.</li>\r\n<li>Provide license proofs for all third-party images, soundtracks, or visual assets in use.</li>\r\n<li>Update website and domain settings to reflect secure (HTTPS) connections and transparent privacy terms.</li></ol></div><!-- CTA -->\r\n<div style=\"text-align: center; margin: 28px 0px 10px\"><a style=\"font-size: 16px; text