(44, 1, NULL, 'pavel@5qb.ro', 'Five Quantum Bits', 'x5qubits@gmail.com', '', '', 'Re: 5 days to your BEST course idea', '<p>Stimate x5qubits@gmail.com,</p>\r\n\r\n<p>Vă mulțumesc pentru email-ul dumneavoastră recent și pentru informațiile suplimentare despre cursul \"5 days to your BEST course idea\".</p>\r\n\r\n<p>Sunt interesat să aflu mai multe despre curriculum-ul cursului, obiectivele de învățare și orice cerințe preliminare necesare.</p>\r\n\r\n<p>De asemenea, aș dori să știu dacă există date sau ore specifice la care se va desfășura cursul și dacă oferă certificate sau acreditări la finalizare.</p>\r\n\r\n<p>Vă rog să-mi oferiți orice informații suplimentare relevante pentru a mă ajuta să decid dacă acest curs este potrivit pentru nevoile mele.</p>\r\n\r\n<p>Vă mulțumesc pentru timpul și considerația dumneavoastră. Aștept cu nerăbdare răspunsul dumneavoastră.</p><br><br>\r\n                <br><br>\r\n                <div style=\"border-left: 2px solid #ccc; padding-left: 10px; margin-top: 10px;\">\r\n                    <p><strong>De la:</strong> x5qubits@gmail.com &lt;x5qubits@gmail.com&gt;<br>\r\n                    <strong>Data:</strong> 2025-10-01 16:41:53<br>\r\n                    <strong>Subiect:</strong> RE: 5 days to your BEST course idea</p>\r\n                    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"><meta name=\"Generator\" content=\"Microsoft Word 15 (filtered medium)\"><!--[if !mso]><style>v\\:* {behavior:url(#default#VML);}\r\no\\:* {behavior:url(#default#VML);}\r\nw\\:* {behavior:url(#default#VML);}\r\n.shape {behavior:url(#default#VML);}\r\n</style><![endif]--><style><!--\r\n/* Font Definitions */\r\n@font-face\r\n	{font-family:Helvetica;\r\n	panose-1:2 11 6 4 2 2 2 2 2 4;}\r\n@font-face\r\n	{font-family:Wingdings;\r\n	panose-1:5 0 0 0 0 0 0 0 0 0;}\r\n@font-face\r\n	{font-family:\"Cambria Math\";\r\n	panose-1:2 4 5 3 5 4 6 3 2 4;}\r\n@font-face\r\n	{font-family:等线;\r\n	panose-1:2 1 6 0 3 1 1 1 1 1;}\r\n@font