pan class=translationmissing><i><u>Read Online</u></i></span></a><o:p></o:p></span></p></td></tr><tr><td valign=top style=\'padding:11.25pt 0in 11.25pt 0in\'><div align=center><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%\'><tr><td valign=top style=\'padding:0in 0in 0in 0in\'><h1 style=\'line-height:28.5pt;mso-line-height-rule:exactly\'><b><span style=\'font-size:24.0pt\'>I Am Starting a Newsletter <o:p></o:p></span></b></h1><p style=\'line-height:18.0pt;mso-line-height-rule:exactly\'><span style=\'font-size:15.0pt;color:#3E3E3E\'>And you are in. <o:p></o:p></span></p></td></tr></table></div></td></tr><tr><td style=\'padding:0in 0in 0in 0in;border-radius: 100%\'><div align=center><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%\'><tr><td style=\'padding:0in 0in 0in 0in\'><div align=center><table class=MsoNormalTable border=1 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%;border-top:solid #E5E7EB 1.0pt;border-left:none;border-bottom:solid #E5E7EB 1.0pt;border-right:none\'><tr><td style=\'border:none;padding:9.0pt 0in 9.0pt 0in\'><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 align=left style=\'margin-left:-2.25pt;margin-right:-2.25pt\'><tr><td style=\'padding:0in 0in 0in 0in\'><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 align=left style=\'margin-left:-2.25pt;margin-right:-2.25pt\'><tr><td style=\'padding:0in 0in 0in 0in\'><div align=center><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0><tr style=\'height:13.5pt\'><td width=18 style=\'width:13.5pt;border:solid #E5E7EB 1.0pt;padding:6.0pt 6.0pt 6.0pt 6.0pt;height:13.5pt\'><p class=MsoNormal align=center style=\'text-align:center\'><span style=\'font-family:\"Arial\",sans-serif\'><img border=0 width=18 height=18 style=\'width:.1875in;height:.1875in\' id=\"_x0000_i1027\" src=\"https://media.beehiiv.com/cdn-cgi/image/fit=scale-down,format=auto,onerror=redirect,quality=80/static_assets/header/like.png\" alt=like></span><span style=\'font-family:\"Arial\",sans-serif\'><o:p></o:p></span></p></td></tr></table></div></td><td width=8 style=\'width:6.0pt;padding:0in 0in 0in 0in\'><p class=MsoNormal><span style=\'font-family:\"Arial\",sans-serif\'>&nbsp;<o:p></o:p></span></p></td></tr></table></td></tr></table></td><td style=\'border:none;padding:9.0pt 0in 9.0pt 0in\'></td></tr></table></div></td></tr></table></div></td></tr><tr><td style=\'padding:0in 0in 0in 0in\'><div><p class=MsoNormal style=\'line-height:0%\'><span style=\'font-family:\"Arial\",sans-serif\'><img border=0 width=1 height=1 style=\'width:.0104in;height:.0104in\' id=\"_x0000_i1026\" src=\"https://link.mail.beehiiv.com/ss/o/u001.b_0LSqXG_RaKzkcMx3jbzQ/4kc/3qGCmp5aRDm0wPbVFN7tFA/ho.gif\"></span><span style=\'font-family:\"Arial\",sans-serif\'><o:p></o:p></span></p></div></td></tr></table></div></div></td></tr><tr id=content-blocks><td valign=top style=\'padding:0in 0in 11.25pt 0in;word-break:break-word\'><div align=center><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%\'><tr><td style=\'padding:0in 11.25pt 0in 11.25pt\'><p style=\'line-height:150%\'>Hello everyone, <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Petar here, co-founder of Neubase. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Since you\'re on this list, it means you\'re either a client of ours or have shown interest in starting a US company. This is Neubase’s new newsletter, and we’ve added you here to keep you in the loop. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>With this email, I want to share why we’re launching this newsletter, what you can expect, and give you the chance to unsubscribe before we get started - just in case you’d rather not receive it. <o:p></o:p></p></td></tr><tr><td valign=top style=\'padding:0in 11.25pt 0in 11.25pt\' id=why-this-newsletter><h3 style=\'line-height:125%\'><b>Why This Newsletter?</b><o:p></o:p></h3></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Most of what we do happens behind the scenes. That was intentional from the start. We wanted you to focus on running your business while we handled compliance seamlessly in the background. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>But after almost three years in business, working with over 200 clients, we’ve realized that this approach has made many of you unaware of the real value we provide. <o:p></o:p></p></td></tr><tr><td style=\'padding:10.5pt 11.25pt 10.5pt 11.25pt\'><table class=MsoNormalTable border=1 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%;border-collapse:collapse;border:none\'><tr><td width=\"50%\" style=\'width:50.0%;border:solid silver 1.0pt;background:#F1F1F1;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Trebuchet MS\",sans-serif;color:#2A2A2A\'>What You See <o:p></o:p></span></p></td><td width=\"50%\" style=\'width:50.0%;border:solid silver 1.0pt;border-left:none;background:#F1F1F1;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Trebuchet MS\",sans-serif;color:#2A2A2A\'>What We Actually Do <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We start the company, get the EIN <o:p></o:p></span></p></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We start the company, get the EIN <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We open the bank account <o:p></o:p></span></p></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We open the bank account <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color: