-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We send you the annual report <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>And the tax form and annual report all over again <o:p></o:p></span></p></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We track updates of the laws that affect your work to alert you if needed <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We research online banks and payment providers where you could open accounts <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We talk to tax consultants to let you know what the requirements for you are <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>We talk to lawyers to undestand better <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>Resolve banking and payment issues with clients <o:p></o:p></span></p></td></tr><tr><td width=\"50%\" valign=top style=\'width:50.0%;border:solid silver 1.0pt;border-top:none;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'></td><td width=\"50%\" valign=top style=\'width:50.0%;border-top:none;border-left:none;border-bottom:solid silver 1.0pt;border-right:solid silver 1.0pt;background:white;padding:3.75pt 3.75pt 3.75pt 3.75pt\'><p class=MsoNormal style=\'mso-margin-top-alt:9.0pt;margin-right:0in;margin-bottom:9.0pt;margin-left:0in;line-height:150%;word-break:break-word\'><span style=\'font-family:\"Helvetica\",sans-serif;color:#2D2D2D\'>Negotiate discounts for bookkeeping software, etc etc. <o:p></o:p></span></p></td></tr></table></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Do you see the difference? Many people assume that most of our work happens during the incorporation process, but that’s simply not true. Running a US company as a non-resident comes with plenty of obstacles, and our job is to clear them before you even notice they’re there. And we want you to be aware of that. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Over time, we’ve gathered a wealth of knowledge about running non-resident US LLCs, and we want to share it with you. Let me give you an example: <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Recently, a client had trouble connecting Shopify and Stripe due to newly introduced restrictions by Shopify. They reached out to me. I called another client who had already set up a Shopify store and asked how he handled it. He shared his workaround, and I passed that solution to the first client. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>But we have many more existing and potential Shopify store owners who might face the same issue. Instead of solving these challenges one by one, I want to share insights like this with all of you. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>And it’s not just about Shopify. We’ll keep you updated on online banks, traditional banks, payment processors, compliance issues, tax rate changes, and more - so you always stay ahead. <o:p></o:p></p></td></tr><tr><td valign=top style=\'padding:0in 11.25pt 0in 11.25pt\' id=what-to-expect><h4 style=\'line-height:112%\'>What to Expect?<o:p></o:p></h4></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Every Tuesday you’ll receive this newsletter. I will share some newly obtained knowledge, legal updates, case studies, lessons learned by the clients, new partnerships beenfiting you, or whatever I may find to be important at that point in time. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>That’s it. As if you were a close friend of mine. <o:p></o:p></p></td></tr><tr><td valign=top style=\'padding:0in 11.25pt 0in 11.25pt\' id=do-you-want-to-unsubscribe><h3 style=\'line-height:125%\'>Do You Want to Unsubscribe?<o:p></o:p></h3></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>As I mentioned earlier, we assumed that all of you would find this information valuable. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>However, if that’s not the case, you can unsubscribe anytime using the link at the bottom of this email. <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Cheers, <o:p></o:p></p></td></tr><tr><td style=\'padding:0in 11.25pt 0in 11.25pt;word-break:break-word\'><p style=\'line-height:150%\'>Petar <o:p></o:p></p></td></tr></table></div></td></tr></table></div></td></tr><tr><td valign=top style=\'padding:0in 0in 0in 0in\'><div align=center><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%\'><tr><td style=\'padding:0in 0in 0in 0in\'></td></tr><tr><td valign=top style=\'border:solid white 1.0pt;background:#030712;padding:0in 0in 0in 0in;border-bottom-left-radius:10px;border-bottom-right-radius:10px\'><div align=center><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%\'><tr style=\'height:7.5pt\'><td style=\'padding:0in 0in 0in 0in;height:7.5pt\'><p class=MsoNormal style=\'line-height:.75pt;mso-line-height-rule:exactly\'><span style=\'font-size:1.0pt;font-family:\"Arial\",sans-serif\'>&nbsp; <o:p></o:p></span></p></td></tr><tr><td valign=top style=\'padding:11.25pt 11.25pt 11.25pt 11.25pt\'><div align=center><table class=MsoNormalTable border=0 cellspacing=0 cellpadding=0 width=\"100%\" style=\'width:100.0%\'><tr><td valign=top style=\'padding:0in 0in 0in 0in\'><p class=MsoNormal align=center style=\'text-align:center;line-height:11.25pt;mso-line-height-rule:exactly;color:#FFFFFF!important\'><span style=\'font-size:9.0pt;font-family:\"Arial\",sans-serif;color:white\'>Update your email preferences or unsubscribe <a href=\"https://link.mail.beehiiv.com/ss/c/u001.ypjoi-8xGNqRkrKQidlbfzMdSICaY9Hsz83fRqvJ_afCvc0h5QWF6hvAOThPPw6e8CBMRyGiVP7mDrTHJfRZnfHFvwXFBwxeULrsj8Xdb_2jDG52LKXXopPdFpuA-eZF45Qoo-fUNEw2K6xXdrHhB4fW9_6iKi6g05r5LjsWU0JJOs6Iwzwk1qYBVX1QdnKay-IKq2AH6XBzF-sCcZDjQJTEwB4GX8K_z_ieK05ut1oqg0uIWgMjeSB8e9zSGslPXSM3UoMPfw8JGhE8QNUjQiCGs_UirvHFZMN-wJjMJ65qh5TOW_mbW6GBbBcnEwMOd7bnLX7rpbwcfOev6oP6Dd6lXN-Znjxmf2fodbP0ok6KG2qp42rzhW-F0HmJr3EspT2mjYhVfT9ywy99P7EhbzedQaAjbnfMENjwkiMzRWqyQl06LcAJVr0_j6MdnSyRmvNK-gTW01gfFzrFJC24nfuER2zJ648HA4vJ6wE8ssa0o6KSG_0scokaLhTn237zizjo1Kp-y9kUZxDqV55B-PuKBRHE68ScpOX